import react from "react";
import { BrowserRouter, Switch, Routes, Route} from "react-router-dom";
import HomePage from "./pages/AdminHomePage";
import LoginPage from "./pages/LoginPage";
import ListTripsPage from "./pages/ListTripsPage";
import ApplicationFormPage from "./pages/ApplicationFormPage";
import AdminHomePage from "./pages/AdminHomePage";
import TripDetailsPage from "./pages/TripDetailsPage";
import CreatePage from "./pages/CreatePage";


const App = () => {
  return (
    <div>
    <BrowserRouter>
      <Switch>
        <Route path="/" element={<HomePage/>}/>
        <Route path="adminhome" element={<AdminHomePage/>}/>
        <Route path="trips" element={<ListTripsPage/>}/>
        <Route path="/admin" element={<LoginPage/>}/>
        <Route path="/form" element={<ApplicationFormPage/>}/>
        <Route path="/tripdetail" element={<TripDetailsPage/>}/>
        <Route path="/createtrip" element={<CreatePage/>}/>
      </Switch>



    </BrowserRouter>
    </div>
  );
}

export default App;
